import React from "react";
import styled from "@emotion/styled";

export const NotDivContainer = styled.div`
  width: 100%;
`;

export const NotDiv = styled.div`
  display: flex;
  margin: auto;
  padding-top: 20rem;
  font-size: 20rem;
  font-weight: 600;
`;

export const TextColor = styled.div`
  color: skyblue;
  margin: 0 10rem 0 10rem;
`;

export const TextColor2 = styled.div`
  color: black;
`;

export const NotFound: React.FC = () => {
  return (
    <NotDivContainer>
      <NotDiv>
        <TextColor>4</TextColor>
        <TextColor2>0</TextColor2>
        <TextColor>4</TextColor>
      </NotDiv>
    </NotDivContainer>
  );
};
